import React, { Component } from "react";
import Card from "./Card";
import "./gallery.css";

export default class Gallery extends Component {
  render() {
    return (
      <div className="gallery">
        <div className="container">
          <Card title={"yep"} imageUrl={"https://picsum.photos/200/300"} />

          <Card title={"nope"} />
          <Card title={"yep"} />
          <Card title={"nope"} />
          <Card title={"yep"} />
        </div>
      </div>
    );
  }
}
